() => {
  // Get all stylesheets
  const styles = [];

  // Inline styles from style tags
  document.querySelectorAll('style').forEach(style => {
    styles.push({
      type: 'inline',
      content: style.textContent
    });
  });

  // External stylesheets
  document.querySelectorAll('link[rel="stylesheet"]').forEach(link => {
    styles.push({
      type: 'external',
      href: link.href
    });
  });

  return {
    styleCount: styles.length,
    styles: styles.slice(0, 5), // First 5 to avoid token limit
    allStylesheetUrls: Array.from(document.querySelectorAll('link[rel="stylesheet"]')).map(l => l.href)
  };
}

() => {
  // Get computed styles for key elements
  const hero = document.querySelector('h1');
  const button = document.querySelector('a[href*="signup"]');

  const getStyles = (el) => {
    if (!el) return null;
    const computed = window.getComputedStyle(el);
    return {
      fontFamily: computed.fontFamily,
      fontSize: computed.fontSize,
      fontWeight: computed.fontWeight,
      color: computed.color,
      backgroundColor: computed.backgroundColor,
      padding: computed.padding,
      margin: computed.margin,
      borderRadius: computed.borderRadius,
      display: computed.display
    };
  };

  return {
    hero: getStyles(hero),
    button: getStyles(button),
    bodyBackground: window.getComputedStyle(document.body).backgroundColor
  };
}

() => {
  // Hero Section
  const heroSection = document.querySelector('h1')?.closest('div');
  const getElementDetails = (el) => {
    if (!el) return null;
    const computed = window.getComputedStyle(el);
    return {
      innerHTML: el.innerHTML?.substring(0, 500),
      classes: el.className,
      styles: {
        display: computed.display,
        flexDirection: computed.flexDirection,
        alignItems: computed.alignItems,
        justifyContent: computed.justifyContent,
        padding: computed.padding,
        margin: computed.margin,
        backgroundColor: computed.backgroundColor,
        backgroundImage: computed.backgroundImage,
        width: computed.width,
        height: computed.height,
        textAlign: computed.textAlign
      }
    };
  };

  const h1 = document.querySelector('h1');
  const h1Styles = h1 ? window.getComputedStyle(h1) : null;

  return {
    hero: {
      text: h1?.textContent,
      styles: h1Styles ? {
        fontSize: h1Styles.fontSize,
        fontWeight: h1Styles.fontWeight,
        lineHeight: h1Styles.lineHeight,
        color: h1Styles.color,
        textAlign: h1Styles.textAlign,
        marginBottom: h1Styles.marginBottom
      } : null,
      container: getElementDetails(heroSection)
    }
  };
}

() => {
  // Find main hero section with "Save Time" text
  const findByText = (text) => {
    const walker = document.createTreeWalker(document.body, NodeFilter.SHOW_TEXT);
    let node;
    while (node = walker.nextNode()) {
      if (node.textContent.includes(text)) {
        return node.parentElement;
      }
    }
    return null;
  };

  const getFullStyles = (el) => {
    if (!el) return null;
    const computed = window.getComputedStyle(el);
    return {
      fontSize: computed.fontSize,
      fontWeight: computed.fontWeight,
      fontFamily: computed.fontFamily,
      lineHeight: computed.lineHeight,
      color: computed.color,
      backgroundColor: computed.backgroundColor,
      padding: computed.padding,
      margin: computed.margin,
      textAlign: computed.textAlign,
      display: computed.display
    };
  };

  const heroTitle = findByText('Save Time');
  const cta = findByText('Start Automating for Free');

  return {
    heroTitle: {
      text: heroTitle?.textContent?.trim(),
      tag: heroTitle?.tagName,
      styles: getFullStyles(heroTitle)
    },
    ctaButton: {
      text: cta?.textContent?.trim(),
      tag: cta?.tagName,
      parentTag: cta?.parentElement?.tagName,
      styles: getFullStyles(cta),
      parentStyles: getFullStyles(cta?.parentElement)
    }
  };
}

() => {
  // Extract pricing cards
  const pricingCards = [];
  const prices = document.querySelectorAll('h2');

  prices.forEach(h2 => {
    const text = h2.textContent;
    if (text.includes('$') && text.includes('/day')) {
      const card = h2.closest('div[class*="column"]') || h2.closest('div');
      const computed = window.getComputedStyle(card);
      pricingCards.push({
        price: text,
        backgroundColor: computed.backgroundColor,
        padding: computed.padding,
        borderRadius: computed.borderRadius,
        border: computed.border,
        boxShadow: computed.boxShadow
      });
    }
  });

  return { pricingCards: pricingCards.slice(0, 3) };
}

() => {
  // Extract feature sections
  const features = [];
  const featureTitles = ['RESIZE', 'REMOVE', 'BACKUP', 'SCHEDULE'];

  featureTitles.forEach(title => {
    const walker = document.createTreeWalker(document.body, NodeFilter.SHOW_TEXT);
    let node;
    while (node = walker.nextNode()) {
      if (node.textContent.trim().toUpperCase().includes(title)) {
        const heading = node.parentElement;
        if (heading.tagName.match(/^H[1-6]$/)) {
          const container = heading.closest('div');
          const computed = window.getComputedStyle(container);
          const headingStyles = window.getComputedStyle(heading);

          features.push({
            title: heading.textContent.trim(),
            headingStyles: {
              fontSize: headingStyles.fontSize,
              fontWeight: headingStyles.fontWeight,
              color: headingStyles.color,
              textAlign: headingStyles.textAlign
            },
            containerStyles: {
              backgroundColor: computed.backgroundColor,
              padding: computed.padding,
              margin: computed.margin,
              borderRadius: computed.borderRadius
            }
          });
          break;
        }
      }
    }
  });

  return { features };
}

() => {
  // Extract social proof stats
  const stats = [];
  const statNumbers = ['650,000+', '21,946,635+'];

  statNumbers.forEach(num => {
    const elements = Array.from(document.querySelectorAll('h2'));
    const statEl = elements.find(el => el.textContent.includes(num));
    if (statEl) {
      const computed = window.getComputedStyle(statEl);
      const container = statEl.closest('div');
      const containerStyles = window.getComputedStyle(container);

      stats.push({
        number: statEl.textContent.trim(),
        label: statEl.nextElementSibling?.textContent?.trim(),
        styles: {
          fontSize: computed.fontSize,
          fontWeight: computed.fontWeight,
          color: computed.color,
          fontFamily: computed.fontFamily,
          textAlign: computed.textAlign
        },
        containerStyles: {
          backgroundColor: containerStyles.backgroundColor,
          padding: containerStyles.padding,
          textAlign: containerStyles.textAlign
        }
      });
    }
  });

  return { socialProof: stats };
}

