    .map(img => {
      const container = img.closest('figure') || img.parentElement;
      const containerStyles = window.getComputedStyle(container);
      return {
        alt: img.alt,
        src: img.src.substring(0, 100),
        width: img.width,
        height: img.height,
        containerStyles: {
          display: containerStyles.display,
          padding: containerStyles.padding,
          margin: containerStyles.margin,
          backgroundColor: containerStyles.backgroundColor
        }
      };
    });

  return { integrationLogos: logoImages };
}

() => {
  // Extract color palette from various elements
  const colors = new Set();

  // Check buttons
  document.querySelectorAll('a[href*="signup"]').forEach(btn => {
    const computed = window.getComputedStyle(btn);
    colors.add(computed.backgroundColor);
    colors.add(computed.color);
  });

  // Check headings
  document.querySelectorAll('h1, h2, h3').forEach(heading => {
    const computed = window.getComputedStyle(heading);
    colors.add(computed.color);
  });

  return {
    colorPalette: Array.from(colors).filter(c => c && c !== 'rgba(0, 0, 0, 0)')
  };
}

